pragma solidity ^0.8.7;

import "./UserOperation.sol";

interface IWallet {

    // validate user's signature and nonce
    // @param requiredPrefund how much this wallet should pre-fund the transaction.
    // @note that after execution, the excess is sent back to the wallet.
    // @note if requiredPrefund is zero, the wallet MUST NOT send anything (the paymaster pays)
    function verifyUserOp(UserOperation calldata userOp, uint requiredPrefund) external;
}
","keccak256":"0x29f98a4e6033cd10007dcc9b569fda950413cc91d8560a67f20a35e8185c9228","license":"GPL-3.0"},"contracts/UserOperation.sol":{"content":"// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.7;

import "hardhat/console.sol";

    struct UserOperation {

        address sender;
        uint256 nonce;
        bytes initCode;
        bytes callData;
        uint callGas;
        uint verificationGas;
        uint preVerificationGas;
        uint maxFeePerGas;
        uint maxPriorityFeePerGas;
        address paymaster;
        bytes paymasterData;
        bytes signature;
    }

library UserOperationLib {

    function getSender(UserOperation calldata userOp) internal view returns (address ret) {
        assembly {ret := calldataload(userOp)}
    }

    //relayer/miner might submit the TX with higher priorityFee, but the user should not
    // pay above what he signed for.
    function gasPrice(UserOperation calldata userOp) internal view returns (uint) {
    unchecked {
        return min(userOp.maxFeePerGas, userOp.maxPriorityFeePerGas + block.basefee);
    }
    }

    function requiredGas(UserOperation calldata userOp) internal pure returns (uint) {
    unchecked {
        return userOp.callGas + userOp.verificationGas + userOp.preVerificationGas;
    }
    }

    function requiredPreFund(UserOperation calldata userOp, uint overhead) internal view returns (uint prefund) {
        return (requiredGas(userOp) + overhead) * gasPrice(userOp);
    }

    function hasPaymaster(UserOperation calldata userOp) internal pure returns (bool) {
        return userOp.paymaster != address(0);
    }

    function pack(UserOperation calldata userOp) internal pure returns (bytes memory ret) {
        //lighter signature scheme. must match UserOp.ts#packUserOp
        bytes calldata sig = userOp.signature;
        assembly {
            let ofs := userOp
            let len := sub(sub(sig.offset, ofs), 32)
            ret := mload(0x40)
            mstore(0x40, add(ret, add(len, 32)))
            mstore(ret, len)
            calldatacopy(add(ret, 32), ofs, len)
        }
        return ret;

        //TODO: eip712-style ?
        return abi.encode(
            userOp.sender,
            userOp.nonce,
            keccak256(userOp.initCode),
            keccak256(userOp.callData),
            userOp.callGas,
            userOp.verificationGas,
            userOp.preVerificationGas,
            userOp.maxFeePerGas,
            userOp.maxPriorityFeePerGas,
            userOp.paymaster,
            keccak256(userOp.paymasterData)
        );
    }

    function hash(UserOperation calldata userOp) internal pure returns (bytes32) {
        return keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32",
            keccak256(pack(userOp))));
    }

    function min(uint a, uint b) internal pure returns (uint) {
        return a < b ? a : b;
    }
}
